import "./App.css";
import { BillCalculator } from "./BillCalculator";
import { FriendProfile } from "./FriendProfile";

function App() {
  return (
    <div className="App">
      <Main />
    </div>
  );
}

export default App;

function Main() {
  return (
    <>
      <ActivePage />
      <FriendProfile />
      <BillCalculator />
    </>
  );
}

function ActivePage() {
  return <div>Hello</div>;
}
